import React, { useState } from 'react';
import {
  Box,
  Typography,
  Paper,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from '@mui/material';
import {
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon,
} from '@mui/icons-material';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';

function Maintenance() {
  const [maintenanceRecords, setMaintenanceRecords] = useState([
    {
      id: 1,
      vehicle: 'Toyota Camry',
      serviceType: 'Oil Change',
      date: '2023-10-15',
      mileage: 45000,
      cost: 45.99,
      notes: 'Regular maintenance',
    },
    {
      id: 2,
      vehicle: 'Honda Civic',
      serviceType: 'Tire Rotation',
      date: '2023-09-20',
      mileage: 32000,
      cost: 25.00,
      notes: 'Front tires moved to rear',
    },
  ]);

  const [openDialog, setOpenDialog] = useState(false);
  const [editingRecord, setEditingRecord] = useState(null);
  const [formData, setFormData] = useState({
    vehicle: '',
    serviceType: '',
    date: new Date(),
    mileage: '',
    cost: '',
    notes: '',
  });

  const serviceTypes = [
    'Oil Change',
    'Tire Rotation',
    'Brake Service',
    'Battery Replacement',
    'Air Filter Change',
    'Transmission Service',
    'Coolant Flush',
    'Other',
  ];

  const handleOpenDialog = (record = null) => {
    if (record) {
      setEditingRecord(record);
      setFormData({ ...record, date: new Date(record.date) });
    } else {
      setEditingRecord(null);
      setFormData({
        vehicle: '',
        serviceType: '',
        date: new Date(),
        mileage: '',
        cost: '',
        notes: '',
      });
    }
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setEditingRecord(null);
  };

  const handleSave = () => {
    if (editingRecord) {
      setMaintenanceRecords(maintenanceRecords.map(r => 
        r.id === editingRecord.id ? { ...formData, id: r.id } : r
      ));
    } else {
      setMaintenanceRecords([...maintenanceRecords, { ...formData, id: maintenanceRecords.length + 1 }]);
    }
    handleCloseDialog();
  };

  const handleDelete = (id) => {
    setMaintenanceRecords(maintenanceRecords.filter(r => r.id !== id));
  };

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">Maintenance Records</Typography>
        <Button
          variant="contained"
          color="primary"
          startIcon={<AddIcon />}
          onClick={() => handleOpenDialog()}
        >
          Add Record
        </Button>
      </Box>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Vehicle</TableCell>
              <TableCell>Service Type</TableCell>
              <TableCell>Date</TableCell>
              <TableCell>Mileage</TableCell>
              <TableCell>Cost</TableCell>
              <TableCell>Notes</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {maintenanceRecords.map((record) => (
              <TableRow key={record.id}>
                <TableCell>{record.vehicle}</TableCell>
                <TableCell>{record.serviceType}</TableCell>
                <TableCell>{new Date(record.date).toLocaleDateString()}</TableCell>
                <TableCell>{record.mileage.toLocaleString()}</TableCell>
                <TableCell>${record.cost.toFixed(2)}</TableCell>
                <TableCell>{record.notes}</TableCell>
                <TableCell>
                  <IconButton onClick={() => handleOpenDialog(record)}>
                    <EditIcon />
                  </IconButton>
                  <IconButton onClick={() => handleDelete(record.id)}>
                    <DeleteIcon />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="sm" fullWidth>
        <DialogTitle>
          {editingRecord ? 'Edit Maintenance Record' : 'Add New Maintenance Record'}
        </DialogTitle>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, pt: 2 }}>
            <FormControl fullWidth>
              <InputLabel>Vehicle</InputLabel>
              <Select
                value={formData.vehicle}
                label="Vehicle"
                onChange={(e) => setFormData({ ...formData, vehicle: e.target.value })}
              >
                <MenuItem value="Toyota Camry">Toyota Camry</MenuItem>
                <MenuItem value="Honda Civic">Honda Civic</MenuItem>
              </Select>
            </FormControl>

            <FormControl fullWidth>
              <InputLabel>Service Type</InputLabel>
              <Select
                value={formData.serviceType}
                label="Service Type"
                onChange={(e) => setFormData({ ...formData, serviceType: e.target.value })}
              >
                {serviceTypes.map((type) => (
                  <MenuItem key={type} value={type}>
                    {type}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>

            <LocalizationProvider dateAdapter={AdapterDateFns}>
              <DatePicker
                label="Date"
                value={formData.date}
                onChange={(newValue) => setFormData({ ...formData, date: newValue })}
                renderInput={(params) => <TextField {...params} fullWidth />}
              />
            </LocalizationProvider>

            <TextField
              label="Mileage"
              type="number"
              value={formData.mileage}
              onChange={(e) => setFormData({ ...formData, mileage: e.target.value })}
            />

            <TextField
              label="Cost"
              type="number"
              value={formData.cost}
              onChange={(e) => setFormData({ ...formData, cost: e.target.value })}
            />

            <TextField
              label="Notes"
              multiline
              rows={3}
              value={formData.notes}
              onChange={(e) => setFormData({ ...formData, notes: e.target.value })}
            />
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Cancel</Button>
          <Button onClick={handleSave} variant="contained" color="primary">
            Save
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default Maintenance;
